import { Route, Redirect } from "react-router-dom";
import React, { FC } from "react";

interface Props {}

const PrivateRoute: FC<Props> = ({ children, ...rest }) => {
  const authenticated = false;
  return <Route {...rest}>{!authenticated} </Route>;
};

export default PrivateRoute;
